import React from "react";
import { View, TextInput, StyleSheet, Button } from "react-native";

export default function SearchBar(props) {
  return (
    <View style={styles.container}>
      <TextInput style={styles.searchInp} placeholder="Search products..." />
      <Button style={styles.buttons} title="X"></Button>
      <Button style={styles.buttons} title="S"></Button>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flexDirection: "row",
    margin: 10,
    borderWidth: 1,
    borderColor: "#ddd",
    borderRadius: 10,
  },
  searchInp: {
    marginTop: 0,
    flex: 1,
    paddingHorizontal: 10,
    paddingHorizontal: 5,
  },
  buttons: {
    backgroundColor: "green",
  },
});
